import React from "react";

const PageNotFound = () => {
  return (
    <>
      <div className="d-flex justify-content-center align-items-center">
        <h1 className="text-danger">OOOps!!!</h1>
        <h1>404 Page not found</h1>;
      </div>
    </>
  );
};
export default PageNotFound;
